import React from "react";

import Icon from "./icon"

export function Sidebar(props) {
  return (<div className="sidebar">   
    <Icon menuItems = {
       {
        icon: homeIcon,
        title: "Principal"
      },
      {
        icon: fireIcon,
        title: "Tendencias"
      },
      {
        icon: subscriptionsIcon,
        title: "Suscripciones"
      },
      {
        icon: playlist,
        title: "Biblioteca"
      }
    }/>
    
  </div>)
}
